import './First.css';
import img1 from '../../images/one.jpeg';
import img2 from '../../images/two.png';
export default function First(){

    const [one,Cone]= useState(true);
    const [two,Ctwo]= useState(false);
    const [three,Cthree]= useState(false);


     return(
        <>
        <div className="f">
             <div className="f-wrapper">
                <div className="f1" id="1">
                    <img src={img1} alt="" className='f-img' />
                </div>
                <div className="f2" id="2">
                    <img src={img2} alt="" className='f-img2' />
                    <div className="f2-text">
                        <div className="f2-heading">Director's Message</div>
                        <div className="f2-cont">
                            <p>
                                Lorem ipsum dolor sit amet consectetur adipisicing elit. Maiores consectetur quos mollitia vero commodi laboriosam harum cumque qui natus ullam ex, aut earum asperiores suscipit dicta fugiat doloribus quod excepturi dolor atque. Explicabo sint vero provident expedita, fugiat cum, aspernatur itaque quibusdam quidem, dicta nostrum at quasi velit illum repudiandae!
                            </p>
                        </div>
                    </div>
                </div>
                <div className="f3" id="3">
                    <img src={img2} alt="" className='f-img2' />
                    <div className="f2-text">
                        <div className="f2-heading">Principal's Message</div>
                        <div className="f2-cont">
                            <p>
                                Lorem ipsum dolor sit amet consectetur adipisicing elit. Maiores consectetur quos mollitia vero commodi laboriosam harum cumque qui natus ullam ex, aut earum asperiores suscipit dicta fugiat doloribus quod excepturi dolor atque. Explicabo sint vero provident expedita, fugiat cum, aspernatur itaque quibusdam quidem, dicta nostrum at quasi velit illum repudiandae!
