                }}></div>
                <div className="c3" onClick={()=>{
                        document.getElementById("1").style.left="-200vw";
                        document.getElementById("2").style.left="-100vw";
                        document.getElementById("3").style.left="0";

                }}></div>
             </div>
            </div>
        </>
     )
}
